import axios from 'axios';
import querystring from 'querystring';
export function addProduct(data, csrttoken) {
  return new Promise(function (resolve, reject) {
    var axiosConfig = {
      headers: {
        'Content-Type': 'application/x-www-form-urlencoded',
        'X-CSRFToken': csrttoken
      }
    };
    data['pics_list'] = querystring.stringify(data['pics_list']);
    var content = {
      data: querystring.stringify(data)
    };
    console.log(content);
    axios.defaults.withCredentials = true;
    axios.post('http://localhost:8000/products/', querystring.stringify(content), axiosConfig).then(function (response) {
      resolve(response.data);
    })["catch"](function (error) {
      reject(error);
    });
  });
}
